import React from "react";

const Pagination = () => {
     const [page, setpage] = React.useState(5);
    // React.useEffect(() => {
    //     axios.get('http://localhost:5000/getdata').then(function (response) {
    //         dispatch({ type: 'DanhSachCayCanh', data: response.data });

    //     })
    //         .catch(function (error) {
                
    //             console.log('Loi ' + error);
    //         });
    // }, []);
    return (
        <div>
            <nav aria-label="Page navigation example">
                <ul className="pagination">
                    <li className="page-item">
                        <a className="page-link" href="#" aria-label="Previous">
                            <span aria-hidden="true">«</span>
                            <span className="sr-only">Previous</span>
                        </a>
                    </li>
                   {
                       
                   }
                    <li className="page-item"><button type="button" class="btn page-link">1</button></li>
                    <li className="page-item"><button type="button" class="btn page-link">2</button></li>
                    <li className="page-item"><button type="button" class="btn page-link">3</button></li>
                    <li className="page-item">
                        <a className="page-link" href="#" aria-label="Next">
                            <span aria-hidden="true">»</span>
                            <span className="sr-only">Next</span>
                        </a>
                    </li>
                </ul>
            </nav>
        </div>
    );
}
export default Pagination;
